local function GetParentAchievementID(achievementID, toTop)
    if not toTop then
        return parentAchievementData[achievementID];
    else
        local id1, id2;
        id1 = parentAchievementData[achievementID];
        if id1 then
            id2 = parentAchievementData[id1];
            return id1, id2
        else
            return id1;
        end
    end
end

NarciAPI.GetParentAchievementID = GetParentAchievementID;


